import React, { Component }from 'react';
import styled from 'styled-components';

const Head = styled.div`

 flex:auto;
 background-color: green;
 h1{
     color:red;
 }

`

class Header extends Component{
    render() {

        return (
            <Head><h1>HEADER</h1></Head>
        )

    }
}

export default Header
